    false,nt"url": null,nt"notes": "The Department of Interior has purchased
    4,000 acres of land on the northeast side of the San Joaquin River near its confluence
    with Bear Creek. Figure 1 is a general location map showing the general area, and
    Figure 2 shows the location of the refuge and wells. The proposed water supply for
    the complex is anticipated to consist of CVP Project water conveyed through the
    San Joaquin River and contracted water from Merced I.D. through Bear Creek. It is
    projected that there may be periods when these flows will not be available. Supplemental
    water is being considered from groundwater. Three wells on the refuge could supply
    part of the groundwater requirements. The following is the result of the evaluation
    of these wells and groundwater quality.",nt"license_title": "License Not Specified",nt"extras":
